ExprLine.OrigStr:
if (GenInState(Gen("Social_TeamSearchTab"), User))
	GenSetFocus(Gen("Social_TeamSearchTab"));
elif (GenInState(Gen("Social_FriendsTab"), User))
	GenSetFocus(Gen("Social_FriendsTab"));
elif (GenInState(Gen("Social_IgnoresTab"), User))
	GenSetFocus(Gen("Social_IgnoresTab"));
elif (GenInState(Gen("Social_TeamTab"), User))
	GenSetFocus(Gen("Social_TeamTab"));
endif

