	GenSendMessage(Self, "Friends");
elif (Self.Var[SelectedTab].String = "Friends")
	GenSendMessage(Self, "Team");
elif (Self.Var[SelectedTab].String = "Team")
	GenSendMessage(Self, "Ignores");
elif (Self.Var[SelectedTab].String = "Ignores")
	GenSendMessage(Self, "Search");
endif

